interface = 'http://127.0.0.1:18089'

config_url = interface + '/config'
run_script_url = interface + '/run_script'

def stable_init(win_index=0):
    has_config_list_url = requests.post(config_url, data={ 'win_index': win_index, 'show_match_url_list': True }).json()['message']
    for i in _stable_config:
        if i[0] in has_config_list_url:
            continue
        data = { 
            'win_index': win_index, # 不配置这个默认值为 0。
            'match_url': i[0],
        }
        if len(i) > 1: data['value'] = i[1]
        if len(i) > 2: data['vtype'] = i[2]
        s = requests.post(config_url, data=data).json()
        print(s, i[0])
    s = requests.post(config_url, data={ 
        "win_index": win_index, 
        "clear_script": True # 清理掉所有额外的 add_script
    }).json()
    print('clear_script', s)

def init(win_index=0, info=None):
    if not info:
        raise 'no info'
    # 配置请求主页的缓存，因为滑块主页是动态变化的。
    s = requests.post(config_url, data= { 
        'win_index': win_index,
        'match_url': info["url"],
        'value': info["body"],
    }).json()
    # 配置第二个动态变化的资源
    t = ''.join([random.choice('0123456789ABCDEF') for i in range(50)])
    s = requests.post(config_url, data= { 
        'win_index': win_index,
        'match_url': '://ynuf.aliapp.org/w/wu.json',
        'value': '''try{umx.wu('G%s');}catch(e){}\ntry{__fycb('G%s');}catch(e){}''' % (t, t),
    }).json()
    # 配置浏览器位置，position 以窗口左上角的坐标为准
    s = requests.post(config_url, data={
        "win_index": win_index,
        "position": "{},{}".format(random.randint(211,290), random.randint(211,290)),
    }).json()
    # 这里模拟请求 url 页面。
