import json
import pprint
import requests

def run(win_index=0):
    data = {
        "win_index": win_index,
        "elements": json.dumps(elements),
        "match_url": "/_____tmd_____/slide",
    }
    s = requests.post(run_script_url, data=data).json()
    if s['status'] == 'success':
        s = s['message']
        url = s['url']
        headers = s['headers']
        s = requests.get(url, headers=headers)
        x5sec = s.headers['Set-Cookie'].split(';')[0] if 'Set-Cookie' in s.headers else ''
        print('{} {} ===> {} {}'.format('成功' if s.json()['code']==0 else '失败', s.text, x5sec[:20], win_index))
    else:
        print(s)
        if 'error' in s:
            print(s['error'])

# 配置持久缓存，执行一次即可。
# 只要服务器不重启，这里就无需执行。
stable_init() 


# 本地请求页面，获取到滑块页面传递给配置函数
url = 'https://www.jiaoyimao.com/'
html = requests.get(url).text


# 配置动态缓存，并虚拟请求该页面。
init(info={"body":html, "url":url}) 
# 对该页面虚拟滑动两次，滑动接口在函数内。
# 通常前两次滑动才有效超过两次基本就不能过了，就需要冲洗请求滑块页面。
for i in range(2): 
    run()